import "./intro.scss"
import { init } from 'ityped'
import { useEffect, useRef } from "react"

export default function Intro() {

    const textRef = useRef();

    useEffect(()=>{
        init(textRef.current, {
          showCursor: false,
          strings: ["Hello", "Hola", "Bonjour", "Ciao", "Guten tag", "Olá", "Kia Ora", "G’day", "Geia", "Zdravo", "Privet", "Nǐ hǎo", "Namaste", "Kon’nichiwa", "Merhaba" ],
        });
    },[])

  return (
      <div className="intro">
        <div className="imgContainer">
          <div className="hello">
            <h1 ref={textRef}></h1>
          </div>
        </div>
      </div>
  )
}
